DROP TABLE IF EXISTS `nepse_login`;
CREATE TABLE `nepse_login` (
  `login_id` int(10) NOT NULL,
  `email` varchar(50) NOT NULL,
  `password` varchar(200) NOT NULL,
  `full_name` varchar(50) NOT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `last_login_date` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `password_changed_on` datetime DEFAULT NULL,
  `password_changed_by` int(5) DEFAULT NULL,
  `unique_string` varchar(32) NOT NULL,
  `privilege` tinyint(1) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

